    console.log(todo, "######");
    const { title , completed} = todo;
    // const navigate = useNavigate();
    return (
        <div style={ {backgroundColor: "grey" ,
         margin: "10px" ,
          padding: '15px',
           width: '150px' }} >
          <h4> {title} </h4>
          <h6> {` completed ${completed}`}</h6>
        </div>
      )
}

export default TodoCard
